import React from 'react';
import Home from './home';

const Header = () => {
    return (
        <div>
            <p>Stranger's Things</p>
            <Link to="/">HOME</Link>

            <Route path="/home">
                <Home />
            </Route>
        </div>
    )
};

export default Header
